export const getTopFive = (data, key, value) => {
    let map = new Map();
    data.forEach(x => {
        if(map.has(x[key])){
            const val = map.get(x[key]) + x[value];
            map.set(x[key], val);
        }
        else{
            map.set(x[key], x[value]);
        }
    });
    
    const sorted = [...map].sort((a, b) => { return a[1] - b[1]});
    console.log(sorted);
}
